import React from 'react'
import {useSelector} from 'react-redux'
import UserIncome from './UserIncome'

const Table = () => {
  const users = useSelector((state) => state.tablesReducer)
  console.log(users)
  return (
    <div>
      {
        users.length === 0 ? 
          <>
            <p>Loading....</p>
          </> :
          <>
            <div className="income">
            <p>Income greater than $5 and owns BMW or Mercedes</p>
            {/* {
                  <UserIncome user={users[0]}/>
              } */}
              <table>
                <tr><th>ID</th><th>First Name</th><th></th></tr>
              {
                users.map((user) => (
                  <UserIncome user={user} key={user?._id} />
              ))
              }
              </table>
      </div>
          </>
      }

    </div>
  )
}

export default Table
